import React from "react";
const cal = "assets/images/book.gif";
function ExtenalForm()
{
    return(
        <>
            <section id="main-section">
                <div>
                    <img src="{cal}" alt="calender img"  />
                </div>
            </section>
        </>
    )
}
export default ExtenalForm;
